    <link rel="stylesheet" id="admin-bar-css" href="http://www.theodo.fr/blog/wp-includes/css/admin-bar.min.css?ver=4.3.1" type="text/css" media="all">
    <link rel="stylesheet" id="mr-frontend-style-css" href="http://www.theodo.fr/blog/wp-content/plugins/multi-rating/assets/css/frontend-min.css?ver=4.3.1" type="text/css" media="all">
    <link rel="stylesheet" id="font-awesome-css" href="http://netdna.bootstrapcdn.com/font-awesome/4.0.3/css/font-awesome.css?ver=4.3.1" type="text/css" media="all">
    <link rel="stylesheet" id="share-button-css-css" href="http://www.theodo.fr/blog/wp-content/themes/theodo-blog-theme/css/share-button.min.css" type="text/css" media="all">
    <link rel="stylesheet" id="noticia-text-css" href="https://fonts.googleapis.com/css?family=Noticia+Text:400,400italic,700,700italic&#038;subset=latin" type="text/css" media="all">

    <link rel="stylesheet" id="1200-css" href="http://www.theodo.fr/blog/wp-content/themes/readme/css/1200.css" type="text/css" media="all">

    <link rel="stylesheet" id="theme-style-css" href="http://www.theodo.fr/blog/wp-content/themes/theodo-blog-theme/style.css" type="text/css" media="all">
    <link rel="stylesheet" id="author-avatars-widget-css" href="http://www.theodo.fr/blog/wp-content/plugins/author-avatars/css/widget.css?ver=1.8.7" type="text/css" media="all">
    <link rel="stylesheet" id="author-avatars-shortcode-css" href="http://www.theodo.fr/blog/wp-content/plugins/author-avatars/css/shortcode.css?ver=1.8.7" type="text/css" media="all">

    <% for (var chunk of webpack.chunks) {
        for (var file of chunk.files) {
          if (file.match(/\.(js|css)$/)) { %>
    <link rel="<%= chunk.initial?'preload':'prefetch' %>" href="<%= htmlWebpackPlugin.files.publicPath + file %>" as="<%= file.match(/\.css$/)?'style':'script' %>"><% }}} %>
  </head>
  <body>
    <div id="app">This is your fallback content in case JavaScript fails to load.</div>
    <!-- Todo: only include in production -->
    <%= htmlWebpackPlugin.options.serviceWorkerLoader %>
    <!-- built files will be auto injected -->
  </body>
</html>
